import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {
    return(
        <div className="graphs">
            <VictoryChart>
                <VictoryBar>
                    data={[
                        { x: "Jan", y: 1234 },
                        { x: "Feb", y: 2048 },
                        { x: "Mar", y: 2600 },
                        { x: "Apr", y: 9000 },
                        { x: "May", y: 1234 },
                        { x: "Jun", y: 2048 },
                        { x: "Jul", y: 2600 },
                        { x: "Aug", y: 9000 },
                        { x: "Sep", y: 1234 },
                        { x: "Oct", y: 2048 },
                        { x: "Nov", y: 2600 },
                        { x: "Dec", y: 9000 }
                        ]}
                    />
                </VictoryBar>
            </VictoryChart>
            <VictoryPie
                data={[
                    { x: "Mon", y: 1234 },
                    { x: "Tue", y: 2048 },
                    { x: "Wed", y: 2600 },
                    { x: "Thu", y: 9000 },
                    { x: "Fri", y: 1234 },
                    { x: "Sat", y: 2048 },
                    { x: "Sun", y: 2600 }
                    ]}
            />
        </div>
    )
}
export default UserDetails;
